@mixin enter_email($weight ){
  display: flex;
  flex-direction: row;
  align-items: center;

  height: 44px;
  width: $weight;
  min-width: 150px;
  padding: 0 14px;
  border: 1px solid rgba(31, 32, 65, 0.25);
  box-sizing: border-box;
  border-radius: 4px;

  outline: none;

}

@mixin Font_Montserrat-Regular($size, $height, $color){
  font-family: Montserrat-Regular, sans-serif;
  font-style: normal;
  font-weight: 400;
  font-size: $size;
  line-height: $height;
  color: $color;
}

@mixin Font_Montserrat-Bold($size, $height, $color){
  font-family: Montserrat-Bold, sans-serif;
  font-style: normal;
  font-weight: 700;
  font-size: $size;
  line-height: $height;
  color: $color;

}

@mixin Font_QuickSand($size, $weight, $height, $color){
  font-family: Quicksand-Regular, sans-serif;
  font-style: normal;
  font-weight: $weight;
  font-size: $size;
  line-height: $height;
  color: $color;
  letter-spacing: 2px;
}



@mixin Font_Open-Sans($size, $weight, $height, $color){
  font-family: Open-Sans, sans-serif;
  font-style: normal;
  font-weight: $weight;
  font-size: $size;
  line-height: $height;
  color: $color;
}


li{
  list-style-type: none;
}

a{
  text-decoration: none;
}
