    margin-bottom: 30px;

    border: 0;
    border-radius: 22px;
    background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);

    img {
      height: 16px;
      width: 16px;
      margin-left: 12px;
    }

    p {
      width: 236px;
    }
  }


  .swap {
    top: 0;
    position: relative;
  }

  .container_checkbox {
    display: block;
    position: relative;
    padding-left: 50px;
    margin-right: 20px;
    cursor: pointer;

    @include Font_Montserrat-Regular(14px, 20px, rgba(31, 32, 65, 0.75));

    input {
      position: absolute;
      opacity: 0;
      cursor: pointer;
    }
  }

  .swap {
