    display: none;
  }

  .container_checkbox input:checked ~ .swap:after {
    display: block;
    margin-left: 20px;
    background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);
  }

  .container_checkbox .swap:after {
    display: block;
    top: 3px;
    left: 3px;
    width: 12px;
    height: 12px;
    border-radius: 50%;
    background: rgba(31, 32, 65, 0.25);
  }


  h3 {
    @include Font_Montserrat-Bold(12px,  15px, #1F2041);
    text-transform: uppercase;
    margin: 0;
  }


  .have_account {
    display: flex;
    flex-direction: row;
    justify-content: space-between;

    p {
      @include Font_Montserrat-Regular(14px,  16px, #000000);
      display: flex;
      align-items: center;
    }
  }


  .border_input {
    padding: 2px;
    height: 40px;
    width: 95px;
    background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);
    border-radius: 22px;
  }

  .background_input {
    display: flex;
    align-items: center;
    justify-content: center;

    height: 100%;
    width: 100%;

    border-radius: 22px;
    background: white;

    p {
      margin: 0;
      @include Font_Montserrat-Bold(12px,  18px, #BC9CFF);
      text-align: center;
      text-transform: uppercase;
    }
  }




